import React, { useState } from 'react';

function Navbar() {
  const [isMenuOpen, setMenuOpen] = useState(false);

  const toggleMenu = () => {
    setMenuOpen(!isMenuOpen);
  };

  return (
    <div className="flex flex-col h-screen">
      <div className="bg-black text-white p-8">
        <div className="flex justify-between">
          <div>
            <h1 className="text-xl">M.Grissa</h1>
          </div>
          <div>
            <i
              onClick={toggleMenu}
              className="fa-solid fa-bars text-xl cursor-pointer"
            ></i>
          </div>
        </div>
      </div>
      {isMenuOpen && (
        <div className="bg-black text-white flex flex-col items-center justify-center flex-grow">
          <a href="/">
            <h1 className="text-5xl">Home</h1>
          </a>
          <a href="/">
            <h1 className="text-5xl">Portfolio</h1>
          </a>
          <a href="/">
            <h1 className="text-5xl">Contact Me</h1>
          </a>
        </div>
      )}
    </div>
  );
}

export default Navbar;
